import React, { Component } from 'react';
import InfoLineItem from '../components/main-page-components/info-line';

const topData = [
  {
    title: '62',
    desc: 'Users',
    theme: 'gray',
    img: '/img/info-1.svg',
  },
  {
    title: '6.8',
    desc: 'Average Mark',
    theme: '',
    img: '/img/info-2.svg',
  },
  {
    title: '9 (14%)',
    desc: 'Underperforming students',
    theme: '',
    img: '/img/info-3.svg',
  },
  {
    title: '83%',
    desc: 'Finished homeworks',
    theme: '',
    img: '/img/info-4.svg',
  },
];

const bottomData = [
  {
    title: '25',
    desc: 'Lections left',
    theme: '',
    img: '/img/info-5.svg',
  },
  {
    title: '139',
    desc: 'Hours spent on lections',
    theme: '',
    img: '/img/info-6.svg',
  },
]

class Main extends Component {

  render() {
    return (
      <div className="main-page">
        <div className="info-block info-block_top">
          <InfoLineItem data={topData} />
        </div>

        <div className="info-line">
          <div className="info-block info-block_left">
            <div className="info-item info-item_chart"> </div>
            <InfoLineItem data={bottomData} />
          </div>
          <div className="info-line info-line_tall">
            <div className="info-item info-item_tall">

            </div>
            <div className="info-item info-item_tall">

            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default Main;
